import './footer.scss'

function Footer (){
    return (
        <section className="footer">
Учебный проект Яндекс.Практикум х BeatFilm.
<div className='footer__block'>
    <p className='footer__copyright'>2022</p>
    <ul className='footer__links'>
        <li>Яндекс.Практикум</li>
        <li>Github</li>
    </ul>
</div>

        </section>
    );
}

export default Footer;
